import React from 'react';
import './Login.css';

function Login() {
  return (    
          <body>

            <header>
              <div id='content'>
                    <img src='/img/usuario50.jpg' alt=''/>LOGIN
              </div>
              <div>
                    <input type="date" value="2022-02-27"></input>
              </div>

           </header>


        </body>
  );
}
export default Login;
